
import streamlit as st
import pandas as pd

st.set_page_config(page_title="البحث عن معلومات العميل", layout="centered")

st.markdown("""<img src="data:image/png;base64," style="height:60px;margin-bottom:10px;" />""", unsafe_allow_html=True)
st.title("🛠️ Maintenance Tracker - Rugaib")
st.markdown("Enter Mobile Number or Invoice Number:")

# إدخال المستخدم
user_input = st.text_input("")

@st.cache_data
def load_data():
    url = "https://docs.google.com/spreadsheets/d/1MitHqD5SZfm-yAUsrc8jkki7zD9zFlH1JXhHTKjfAhs/export?format=csv"
    return pd.read_csv(url)

df = load_data()

if st.button("بحث"):
    if user_input.strip() == "":
        st.warning("Please enter a mobile number or invoice number.")
    else:
        results = df[
            (df["رقم الجوال"].astype(str) == user_input) |
            (df["رقم الفاتورة"].astype(str) == user_input)
        ]
        if not results.empty:
            for _, row in results.iterrows():
                st.success("**الاسم:** " + str(row["اسم العميل"]) + 
                           "\n**رقم الجوال:** " + str(row["رقم الجوال"]) +
                           "\n**رقم الفاتورة:** " + str(row["رقم الفاتورة"]) +
                           "\n**العنوان:** " + str(row["العنوان"]) +
                           "\n**تحديث D365:** " + str(row["تحديث D365"]))
        else:
            st.error("No matching records found.")

st.caption("Rugaib Maintenance Tracker - Powered by Streamlit")
